import PropTypes from "prop-types";
import Link from "next/link";

function indexPage() {
  return (
    <div>
      <h1>The main Page</h1>
      <p>
        Go to <Link href="/auth">Auth</Link>
      </p>
    </div>
  );
}

indexPage.propTypes = {};

export default indexPage;
